.modform{
    border:2px solid black;
    padding: 10px;
    
    }
    
    .modinp{
    width:300px;
    text-align: center;
    padding: 3px;
    position: relative;
    left:20%;
    margin-top: 20px;
    }
    #modtexta{
        width:300px;
        height: 100px;
        position: relative;
        left:20%;
        text-align: center;
    }
    #modsel{
        width:200px;
        padding: 2px;
        text-align: center;
        position: relative;
        left:30%;
    }
    #modsub{
        width:200px;
        padding: 2px;
        text-align: center;
        position: relative;
        left:30%;
        background-color:#1dbf73;
    }
    #modcan{
        padding: 5px;
        position: relative;
        right: 35%;
        width:100px;
        background-color: lightblue;
    }
